const TableRow = (props) =>{
    const tableRow = props.tableRow;
    return <tr>
        <td>{tableRow.name}</td>
        <td>{tableRow.batch}</td>
        <td>{tableRow.deal}</td>
        <td>{tableRow.free}</td>
        <td>{tableRow.mrp}</td>
        <td>{tableRow.rate}</td>
        <td>{tableRow.exp}</td>
        
    </tr>
}
export default TableRow;
